import React from "react";
import "./component-styles/card.css";
import "./component-styles/ticket.css";
import { companies } from "../data";

companies().then((data) => console.log(data));

const TicketSegment = (props) => (
  <div className="TicketSegment">
    <div className="SegmentInfo"></div>
    <div className="SegmentInfo"></div>
    <div className="SegmentInfo"></div>
  </div>
);

const FlightTickets = (props) => (
  <div className="Card Ticket" style={{ width: "100%", height: "184px" }}>
    <div className="TicketUpper">
      <div className="Price">13 444 P</div>
      <div className="CompanyLogo">S7</div>
    </div>
    <div className="TicketLower">
      <div className="Info">10000</div>
      <div className="Info">10000</div>
      <div className="Info">10000</div>
      <div className="Info">10000</div>
      <div className="Info">10000</div>
      <div className="Info">10000</div>
    </div>
  </div>
);

export default FlightTickets;
